    method: "GET",
    credentials: "include",
    withCredentials: true,

    headers: {
      "Content-Type": "application/json",
    },
  })
    .then((resp) => res.json())

    .then((data) => changeName(data))
    .catch((err) => console.log(err));
  return <h1>Hello {name} </h1>;
}

